import "aos/dist/aos.css";

export default function ProductDefaultPage(props) {
  return (
    <>
      <div className="product-default-page">
        <img src="./images/productLanding/pic5.jpg" />
        <div className="overlay">
          <h1 className="animate__animated  animate__zoomIn">
            Discover Your Perfect Wig Today!
          </h1>
          <p>
            Welcome to our wig collection, where you can find the perfect wig to
            suit your style and needs. Our wigs are made with high-quality
            materials and designed to look and feel natural.
          </p>
          <a href="#featured-container">Featured Products</a>
        </div>
      </div>
      <div id="featured-container">
        {props.featured.map((product) => {
          return (
            <div className="featured-product-card animate__animated animate__slideInUp">
              <img src={product.image} />
              <div className="featured-product-card-overlay">
                <h1>{product.name}</h1>
                <p>{product.description}</p>
                <button>Shop Now</button>
              </div>
            </div>
          );
        })}
      </div>
    </>
  );
}
